import { NavLink } from "react-router-dom";
import "./style.css";

const Navbar = () => {
  return (
    <>
      <header>
        <div className="nav-bar">
          <NavLink to="/" className="brand">E-Cart</NavLink>
          <div className="search-br">
            <input type="text" placeholder="Serch Product" />
          </div>
          <NavLink to="/cart" className="cart">Cart</NavLink>
        </div>
        <div className="navbar-wrapper">
            <div className="items">Filter By</div>
            <div className="items">No Filter</div>
            <div className="items">Mobiles</div>
            <div className="items">Laptop</div>
            <div className="items">Tablet</div>
            <div className="items">{">="}29999</div>
            <div className="items">{">="}49999</div>
            <div className="items">{">="}69999</div>
            <div className="items">{">="}89999</div>
        </div>
      </header>
    </>
  );
};

export default Navbar;
